import { useState } from "react";
import "./App.css";

function App() {
 const [users, setUsers] = useState([
    {name: "Aram", age: 36, id: 1},
    {name: "Emad", age: 40, id: 1},
    {name: "Elina", age: 3, id: 1}
  ]);

  return (
    <div className="App">
      {users.map((user, index)=>{
        return (
          <h1 key={index}>{user}</h1>
        );
      })}

    </div>
  );
}

export default App;
